We add the following preamble to all crates‚Äô lib.rs: #![warn(clippy::pedantic)]
#![forbid(clippy::integer_arithmetic)]
#![forbid(missing_docs)]
#![forbid(unsafe_code)]
#![allow(/* known bad lints outlined below */)] We enable #![forbid(missing_docs)] for a couple of reasons: it forces developers to write doc comments for publicly exported items it serves as a reminder that the item you‚Äôre working on is part of your public API We enable #![forbid(unsafe_code)] to reinforce the fact that unsafe code should not be mixed in with the rest of our code . More details are below. We enable #![forbid(integer_arithmetic)] to prevent you from writing code like: let x = 1;
let y = 2;
let z = x + y; Why is this bad? Integer arithmetic may panic or behave unexpectedly depending on build settings. In debug mode, overflows cause a panic, but in release mode, they silently wrap. In both modes, division by 0 causes a panic. By forbidding integer arithmetic, you have to choose a behaviour, by writing either: a.checked_add(b) to return an Option that you can error-handle a.saturating_add(b) to return a + b, or the max value if an overflow occurred a.wrapping_add(b) to return a + b, wrapping around if an overflow occurred By being explicit, we prevent the developer from ‚Äúsimply not considering‚Äù how their code behaves in the presence of overflows. In a ledger application, silently wrapping could be catastrophic, so we really want to be explicit about what behaviour we expect.

