It‚Äôs tempting to write a function like this: fn use_str(s: impl AsRef<str>) { let s = s.as_ref(); println!("{s}");
} Unfortunately, this has a few downsides: it increases compile times if used in a trait, it makes that trait not object-safe if the body of the function is large, it bloats binary size, which can hurt performance by increasing pressure on the instruction cache it makes type inference harder Now that‚Äôs not to say you should never use generics. Of course, there are plenty of good reasons to use generics. But if the only reason to make your function generic is ‚Äúslightly easier to use at the call-site‚Äù, consider just using a plain reference/slice instead: fn use_str(s: &str) { println!("{s}");
} This does mean you may have to use .as_ref() at the call-site, but generally this is preferred compared to the downsides of using generics. Similar logic applies to AsRef<Path>, Into<String>, and a few other common types. The general principle is that a little bit of extra text at the call-site is usually worth the benefits from not having generic functions.

