In general, prefer plain functions over a struct + trait implementation. For example, instead of this: // BAD
trait GetBar { fn bar(&self) -> &Bar;
} impl GetBar for Foo { fn bar(&self) -> &Bar { &self.bar }
} write this: // GOOD
impl Foo { fn bar(&self) -> &Bar { &self.bar }
} I.e., don‚Äôt use a trait if you don‚Äôt need it. A common reason why people do this is to mock out a particular function call for testing. This can be useful in a few select places, such as interacting with the real world. Eg, networking, clocks, randomness, etc. However, it has some significant downsides. it means you‚Äôre not actually testing this code. This might be fine for some types of code (e.g. database code). It might be unreasonable to rely on a database for unit tests. However, if your whole test suite is organized around this, your business logic won‚Äôt get tested. it forces you to use a trait, which have restrictions that plain functions don‚Äôt have: it forces you into either generics or dynamic dispatch (often with a heap allocation if you don‚Äôt want to play the lifetime game) you may now have to think about object safety, which can be very tricky for some APIs async functions are not properly supported it‚Äôs not usable in a const context Some alternative patterns are: try to rewrite your test to avoid needing a mock if you know all the variants at compile time, consider using an enum swap out the implementation with conditional compilation

