Error handling in Rust is complex, which represents the real-world complexity of error handling. Broadly speaking, there are two types of error: Expected errors are errors that are expected to occur during normal operation of the application. For example, in bug free code, it would still be expected to see network timeout errors, since that networking is inherently fallible. The exact error handling strategy may vary, but often involves returning a Result. Unexpected errors are errors that are not expected to occur. If they do occur, it represents a bug. These errors are handled by panicking. As much as possible, we try to make these cases impossible by construction by using the correct types for data. For example, imagine you have a struct that represents ‚Äúa list with at least one element‚Äù. You could write: struct NonEmptyList<T> { inner: Vec<T>,
} impl<T> NonEmptyList<T> { /// Doesn't need to be an Option<&T> because the list is guaranteed to have at least 1 element fn first(&self) -> &T { inner.get(0).expect("guaranteed to have at least 1 element") }
} This would be fine , since it represents a bug if this panic is ever hit. But it would be better to write it like this: struct NonEmptyList<T> { head: T, tail: Vec<T>,
} impl<T> NonEmptyList<T> { fn first(&self) -> &T { &self.head }
} This provides the compiler with more information about the invariants of our type. This allows us to eliminate the error at compile time.

