Well-behaved code doesn‚Äôt panic. So if our response to encountering an expected error is to panic, our software is not well-behaved. Instead, we should use Result<T, E> to represent data that might be an error. But how do we pick E? There are two main choices for E: Use thiserror for recoverable errors In contexts where we may want to recover from errors, we should use a dedicated error type. We generate these with thiserror: #[derive(Debug, Error)]
enum FooError { #[error("failed to bar")] Bar, #[error("failed to baz")] Baz,
} This allows the user to write: match try_foo() { Ok(foo) => println!("got a foo: {foo}"), Err(FooError::Bar) => eprintln!("failed to bar"), Err(FooError::Baz) => eprintln!("failed to baz"),
} Use color_eyre for unrecoverable errors In contexts where we don‚Äôt want to recover from errors, use Report from the color_eyre crate. This is a trait object based error type which allows you to ‚Äúfire and forget‚Äù an error. While technically possible , it‚Äôs less ergonomic to recover from a Result<T, Report>. Therefore, only use this in contexts where the correct behaviour is ‚Äúexit the program‚Äù. This is commonly the case in CLI apps. However , even in CLI apps, it‚Äôs good practice to split the logic into a lib.rs file (or modules) and have a separate binary. Found a bug? Edit this page on GitHub.

